webpackJsonp([90014604261252],{605:function(a,e){a.exports={data:{markdownRemark:{html:'<h3>Hacktivity Upvoting</h3>\n<p>Users can now upvote reports that they’re interested in in order to create a “Popular” sorting on Hacktivity where reports with the most upvotes are featured on top.\n\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/june_2016_upvoting-71a1ca87401d668d6d07a6b4925bccaa-1284a.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 318px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 15.723270440251572%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="june_2016_upvoting"\n        title=""\n        src="/static/june_2016_upvoting-71a1ca87401d668d6d07a6b4925bccaa-cbc30.png"\n        srcset="/static/june_2016_upvoting-71a1ca87401d668d6d07a6b4925bccaa-ed0be.png 125w,\n/static/june_2016_upvoting-71a1ca87401d668d6d07a6b4925bccaa-59fa0.png 250w,\n/static/june_2016_upvoting-71a1ca87401d668d6d07a6b4925bccaa-cbc30.png 500w,\n/static/june_2016_upvoting-71a1ca87401d668d6d07a6b4925bccaa-1284a.png 636w"\n        sizes="(max-width: 318px) 100vw, 318px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<h3>Hacker Leaderboard</h3>\n<p>We’ve deprecated the Thanks page at <a href="https://hackerone.com/thanks">https://hackerone.com/thanks</a> and turned it into a hacker leaderboard that’s segmented into more granular time periods and sortable by Signal, Impact, and Reputation. See who’s on top <a href="https://hackerone.com/leaderboard">here</a>.\n\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/june_2016_leaderboard-c1d3e273e486449a07f18fafd1886d48-130bd.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 46.59400544959127%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="june_2016_leaderboard"\n        title=""\n        src="/static/june_2016_leaderboard-c1d3e273e486449a07f18fafd1886d48-e7ffa.png"\n        srcset="/static/june_2016_leaderboard-c1d3e273e486449a07f18fafd1886d48-49813.png 125w,\n/static/june_2016_leaderboard-c1d3e273e486449a07f18fafd1886d48-dc8a5.png 250w,\n/static/june_2016_leaderboard-c1d3e273e486449a07f18fafd1886d48-e7ffa.png 500w,\n/static/june_2016_leaderboard-c1d3e273e486449a07f18fafd1886d48-dda24.png 750w,\n/static/june_2016_leaderboard-c1d3e273e486449a07f18fafd1886d48-c5f18.png 1000w,\n/static/june_2016_leaderboard-c1d3e273e486449a07f18fafd1886d48-130bd.png 1468w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<h3>Badges</h3>\n<p>Hackers can now receive badges when they meet certain criteria or achieve certain events to showcase on their profile.\n\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/june_2016_badges-aa5c61bed25a37508cebe52f41c356b0-0afe6.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 498px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 54.01606425702812%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="june_2016_badges"\n        title=""\n        src="/static/june_2016_badges-aa5c61bed25a37508cebe52f41c356b0-dd097.png"\n        srcset="/static/june_2016_badges-aa5c61bed25a37508cebe52f41c356b0-ff80a.png 125w,\n/static/june_2016_badges-aa5c61bed25a37508cebe52f41c356b0-fd918.png 250w,\n/static/june_2016_badges-aa5c61bed25a37508cebe52f41c356b0-dd097.png 500w,\n/static/june_2016_badges-aa5c61bed25a37508cebe52f41c356b0-eb84d.png 750w,\n/static/june_2016_badges-aa5c61bed25a37508cebe52f41c356b0-0afe6.png 996w"\n        sizes="(max-width: 498px) 100vw, 498px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<h3>API Documentation</h3>\n<p>We introduce the first version of the HackerOne API to empower programs to build custom metrics and dashboards. Learn more about our <a href="https://www.hackerone.com/blog/launching-the-hackerone-api">API Documentation</a>.</p>\n<h3>UI Improvements to Default Automatic Invitations</h3>\n<p>We’ve cleaned up the UI to Invite Hackers so that it’s clear that there’s a single call-to-action to privately launch a program by turning automatic invitations on.\n\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/june_2016_automatic_invites-a96d476d7ee1a302ef0c251cb17bea81-7bbc8.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 20.388349514563107%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="june_2016_automatic_invites"\n        title=""\n        src="/static/june_2016_automatic_invites-a96d476d7ee1a302ef0c251cb17bea81-e7ffa.png"\n        srcset="/static/june_2016_automatic_invites-a96d476d7ee1a302ef0c251cb17bea81-49813.png 125w,\n/static/june_2016_automatic_invites-a96d476d7ee1a302ef0c251cb17bea81-dc8a5.png 250w,\n/static/june_2016_automatic_invites-a96d476d7ee1a302ef0c251cb17bea81-e7ffa.png 500w,\n/static/june_2016_automatic_invites-a96d476d7ee1a302ef0c251cb17bea81-dda24.png 750w,\n/static/june_2016_automatic_invites-a96d476d7ee1a302ef0c251cb17bea81-c5f18.png 1000w,\n/static/june_2016_automatic_invites-a96d476d7ee1a302ef0c251cb17bea81-7bbc8.png 1030w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n      </p>',frontmatter:{path:"/changelog/2016/june",title:"June 2016"}}},pathContext:{}}}});
